import { CommonModule } from '@angular/common';
import { Component } from '@angular/core';

@Component({
  selector: 'app-primo',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './primo.component.html',
  styleUrl: './primo.component.css'
})
export class PrimoComponent {

  name = "inizio";
  clickBottone(link: string){
    window.open(link);
    
  }
  setBtn(nomeT: string){
    if(nomeT == "milano" ){
      this.name = "milano";
    }
    if(nomeT == "new york" ){
      this.name = "new york";
    }
    if(nomeT == "amsterdam" ){
      this.name = "amsterdam";
    }
    if(nomeT == "tenerife" ){
      this.name = "tenerife";
    }
    if(nomeT == "lisbona" ){
      this.name = "lisbona";
    }
  
  }



  posti = [
    {nome : "milano", nazione : "italia", immaggine : "data:image/jpeg;base64,"},
    {nome : "new york", nazione : "usa", immaggine : "data:image/jpeg;base64,"},
    {nome : "amsterdam", nazione : "olanda", immaggine : "https://upload.wikimedia.org/wikipedia/commons/thumb/5/53/Amsterdam_June_2018.jpg/800px-Amsterdam_June_2018.jpg"},
    {nome : "tenerife", nazione : "spagna", immaggine : "data:image/jpeg;base64,"},
    {nome : "lisbona", nazione : "portogallo", immaggine : "data:image/jpeg;base64,"},
    
  ]

}
